#include "include.h"


char img_P[P_row][P_col];

void init_P()
{
    int i=0;
    int j=0;

    for(i=0;i<P_row;i++)
    {
        for(j=0;j<P_col;j++)
        {
            img_P[i][j]=0;
        }
    }
}


void tran_B_P()
{
    int i=0;
    int j=0;

    for(i=0;i<P_row;i++)
    {
        for(j=P_T[i][0]+1;j<P_T[i][1];j++)
        {
            img_P[i][j]=img_bucket[BP_rivise[i][j].x][BP_rivise[i][j].y];
        }
    }
}


void show_P()
{
    int i=0;
    int j=0;

    for(i=0;i<P_row;i++)
    {
        for(j=0;j<P_col;j++)
        {
            if(img_P[i][j]!=1)
            {
                printf(" ");
            }
            else
                printf("1");
        }
        printf("\n");
    }
}

